import React, { useState } from "react";
import { Paper } from '@material-ui/core';
import { ThemeProvider } from "@material-ui/core";
import { createMuiTheme, makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';
import { Typography } from '@material-ui/core';
import { Button } from '@material-ui/core';
import PeepOne from '../../../assets/peep-one.png';
import PeepTwo from '../../../assets/peep-two.png';
import "../landingCard/landingCard.css";

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      '& > *': {
        margin: theme.spacing(1),
        width: theme.spacing(16),
        height: theme.spacing(16),
      },
    },
  }));

export default function LandingCard(props){ //add props
    const classes = useStyles();

    return (
        <ThemeProvider>
            <Paper elevation={7} className="paper">
                <img src={PeepOne} className="peepOne"/>
                <Grid container>
                    <Grid item xs={12} sm={12} md={12} lg={12}>
                        <Typography align="center" className="cardLevel" variant="h2">Strangers Or Not</Typography>
                    </Grid>
                    <Grid item xs={12} sm={12} md={12} lg={12}>
                        <Typography align="center" variant="h6" className="cardQuestion">A Game to Create Human Connection</Typography>
                    </Grid>
                    <Grid item xs={12} sm={12} md={12} lg={12}>
                        <Grid container>
                            <Grid item xs={3} sm={3} md={3} lg={3}></Grid>
                            <Grid item xs={7} sm={7} md={7} lg={7}>
                                <Button variant="contained" size="large" fullWidth className="landingButtons rightButton">Play Game</Button>
                            </Grid>
                            <Grid item xs={2} sm={2} md={2} lg={2}></Grid>
                        </Grid>
                    </Grid>
                </Grid>
                <img src={PeepTwo} className="peepTwo"/>
            </Paper>
        </ThemeProvider>
    )
};
